import { StatusBar } from 'expo-status-bar';

import * as React from 'react';

import { Text, View, StyleSheet,ImageBackground, ScrollView, TextInput, Button, TouchableOpacity, SafeAreaView, FlatList, Image, Rating, AirbnbRating } from 'react-native';



const App = ({navigation}) => {

  return (
    <ImageBackground
    style={{flex:1
    }}
    resizeMode={'cover'}
    // source={require('./assets/imgs/login/bg.png')}
  >
    <ScrollView>
      <View style={styles.container}>
        
        <Text style={styles.textHeading}> Sign Up </Text>

        <Text style={styles.textLabel}> Name </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter Name"
        />

        <Text style={styles.textLabel}> Business Name </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter Business Name"
        />

        <Text style={styles.textLabel}> Email </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter Email"
          defaultValue=""
        />

        <Text style={styles.textLabel}> Mobile Number </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter Mobile Number"
        />

        <Text style={styles.textLabel}> Vertical </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Select Vertical"
        />

        <Text style={styles.textLabel}> CR Number </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter CR Number"
        />

        <Text style={styles.textLabel}> City </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter City"
        />

        <Text
          style={styles.textLabel}> Country </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter Country"
        />

        <Text
          style={styles.textLabel}> Passowrd </Text>
        <TextInput
          style={styles.textInput}
          placeholder="Enter Passowrd"
        />

        <Text
          style={{
            fontSize: 13,
            marginBottom: 2,
            marginTop: 8,
            color: "#444",
            fontWeight: 'bold'
          }}>
          I agree to<Text style={{ color: "#00C8E4" }}> Terms & Conditions</Text> of Self Care & Car Care
            </Text>

        <View style={[{
          width: "94%",
          marginStart: 10,
          marginEnd: 10,
          marginTop: 24,
          marginBottom: 16,
          backgroundColor: "#00C8E4",
          borderRadius: 6,
        }]}>
          <Button
            title="Sign Up"
            color="#00C8E4"
            onPress={() =>
              navigation.navigate('App')
            }
          />
        </View>

        <Text
          style={{
            fontSize: 16,
            marginBottom: 16,
            color: "#808080"
          }}>Sign in with Social Account</Text>

        <View style={styles.buttonContainer}>
          <View style={[{
            width: "46%",
            marginEnd: 8,
            backgroundColor: "#3b5998",
            borderRadius: 4,
          }]}>
            <TouchableOpacity>
              <Text style={{
                textAlign: 'center',
                padding: 10,
                fontSize:14,
                color: '#FFFFFF'
              }}> FaceBook </Text>
            </TouchableOpacity>
          </View>

          <View style={[{
            width: "46%",
            marginStart: 8,
            backgroundColor: "#FFFFFF",
            borderRadius: 4,
          }]}>
            <TouchableOpacity>
              <Text style={{
                textAlign: 'center',
                padding: 10,
                fontSize:14,
                color: '#000000'
              }}> Google </Text>
            </TouchableOpacity>

          </View>
        </View>

        <Text
          style={{
            fontSize: 16,
            marginBottom: 48,
            marginTop: 32,
            color: "#1A1A1A"
          }}>Already have an account?
            <TouchableOpacity onPress={() => {navigation.navigate("Login")}}>
              <Text style={{ color: "#00C8E4" }}> Sign In </Text>
            </TouchableOpacity> 
        </Text>
        <StatusBar style="auto" />
      </View>
    </ScrollView>
  </ImageBackground>

  );
}

export default App;


const styles = StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
    backgroundColor: '#FFFFFF',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 66,
    height: 58,
  },
  buttonContainer: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
  },
  checkboxContainer: {
    flexDirection: "row",
    marginBottom: 20,
  },
  textHeading: {
    width: '98%',
    fontSize: 18,
    marginStart: 16,
    marginBottom: 16,
    marginTop: 32,
    fontWeight: 'bold'
  },
  textLabel: {
    textAlign: 'left',
    marginStart: 8,
    marginBottom: 8,
    color: '#4D4D4D',
    marginTop: 16,
    fontWeight: 'bold',
    width: "94%",
  },
  textInput: {
    height: 40,
    width: "94%",
    padding: 10,
    borderRadius: 4,
    borderColor: 'gray',
    backgroundColor: '#FFFFFF',
    borderWidth: 1,
  },

  buttonStyle: {
    width: "46%",
    marginEnd: 8,
    backgroundColor: "#00C8E4",
    borderRadius: 40,
  },
  buttonStyleWhite: {
    width: "46%",
    marginEnd: 8,
    backgroundColor: "#E6E6E6",
    borderRadius: 40,
  },
  containerList: {
    width: "100%",
    marginTop: StatusBar.currentHeight || 0,
  },
  item: {
    backgroundColor: '#FFFFFF',
    padding: 8,
    width: "92%",
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 8,
    marginVertical: 8,
    marginHorizontal: 16,
  },
  title: {
    fontSize: 32,
  },
  textBorder: {
    width: "50%",
    fontSize: 11,
    color: '#333333',
    fontWeight: 'bold',
    marginTop: 4,
    marginEnd: 4,
    marginStart: 4,
    borderRadius: 4,
    borderColor: '#E6E6E6',
    borderWidth: 1, padding: 4
  },
});


